figuration\n# PROD\nif [ \"${CONFIGURATION}\" == \"Debug-prod\" ] || [ \"${CONFIGURATION}\" == \"Release-prod\" ] || [ \"${CONFIGURATION}\" == \"Profile-prod\" ]\nthen\n    echo \"Using ${FIREBASE_GOOGLE_SERVICE_FILE_PROD}\"\n    cp \"${FIREBASE_GOOGLE_SERVICE_FILE_PROD}\" \"${FILE_DESTINATION}\"    \n\n# QA    \nelif [ \"${CONFIGURATION}\" == \"Debug-qa\" ] || [ \"${CONFIGURATION}\" == \"Release-qa\" ] || [ \"${CONFIGURATION}\" == \"Profile-qa\" ]\nthen\n    echo \"Using ${FIREBASE_GOOGLE_SERVICE_FILE_QA}\"\n    cp \"${FIREBASE_GOOGLE_SERVICE_FILE_QA}\" \"${FILE_DESTINATION}\"\n\n# DEV\nelif [ \"${CONFIGURATION}\" == \"Debug-dev\" ] || [ \"${CONFIGURATION}\" == \"Release-dev\" ] || [ \"${CONFIGURATION}\" == \"Profile-dev\" ]\nthen\n    echo \"Using ${FIREBASE_GOOGLE_SERVICE_FILE_DEV}\"\n    cp \"${FIREBASE_GOOGLE_SERVICE_FILE_DEV}\" \"${FILE_DESTINATION}\"\nelse\n    echo \"Error: invalid configuration specified: ${CONFIGURATION}\"\nfi\n\n";
